  false,\n\t\"url\": null,\n\t\"notes\": \"NOAA's National Geophysical Data Center
  (NGDC) is building high-resolution digital elevation models (DEMs) for select U.S.
  coastal regions. These integrated bathymetric-topographic DEMs are used to support
  individual coastal States as part of the National Tsunami Hazard Mitigation Program's
  (NTHMP) efforts to improve community preparedness and hazard mitigation. Bathymetric,
  topographic, and shoreline data used in DEM compilation are obtained from various
  sources including: NGDC; the U.S. Geological Survey (USGS); Naval Oceanographic
  Office (NAVOCEANO); NOAA's Coastal Service Center; and other federal, state, and
  local government agencies, academic institutions, and private companies. DEMs are
  referenced to the vertical tidal datum of Mean High Water (MHW) and horizontal datum
  of World Geodetic System 1984 geographic (WGS 84). Grid spacing for the DEM is 1/3
  arc-second (~10 meters).\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
